import { Table } from "antd";

function ThreatsTable() {
  return (
    <div>
      <h3 style={{ color: "white" }}>Detected Cyber Security Threats</h3>
      <Table dataSource={dataSource} columns={columns} size="small" />
    </div>
  );
}

const dataSource = [
  {
    key: "1",
    datetime: "01-01-2023 12:00:00",
    ip: "192.168.1.100",
    mac: "10 Downing Street",
    threat: "Trojan",
  },
];

const columns = [
  {
    title: "Date / Time",
    dataIndex: "datetime",
    key: "datetime",
  },
  {
    title: "Targeted IP Address",
    dataIndex: "ip",
    key: "ip",
  },
  {
    title: "MAC Address",
    dataIndex: "mac",
    key: "mac",
  },
  {
    title: "Threat Type",
    dataIndex: "threat",
    key: "threat",
  },
];

export default ThreatsTable;
